CREATE TABLE obat(
   ID_OBAT    VARCHAR(5) NOT NULL PRIMARY KEY
  ,NAMA       VARCHAR(50) NOT NULL
  ,DESKRIPSI  VARCHAR(250) NOT NULL
  ,STOK       INTEGER  NOT NULL
  ,Jenis_Obat VARCHAR(5) NOT NULL
);

create sequence obat_sq
   minvalue 1
  maxvalue 999999999
  start with 1
  increment by 1
  cache 20;

create or replace trigger obat_trig
before insert on obat
for each row
declare
  new_id varchar(5);
  cur_id number;
begin
  if inserting and :new.id_obat is null then
    cur_id := obat_sq.nextval;
    if cur_id < 10 then
      select concat('O000', cur_id) into new_id from dual;
    else
      if cur_id < 100 then
        select concat('O00', cur_id) into new_id from dual;
      else 
        if cur_id < 1000 then
          select concat('O0', cur_id) into new_id from dual;
        else
          select concat('O', cur_id) into new_id from dual;
        end if;
      end if;
    end if;
  :new.id_obat := new_id;
  end if;
end;

